import './CreateTodoButtom.css';
import React from 'react';



function CreateTodoButton({ setOpenModal }) {
    return (
        <button
            className="CreateTodoButton"
            onClick={
                () => {
                    setOpenModal(state => !state);
                }
            }
        >+</button>
    );
}
export { CreateTodoButton };
